import { Component } from "react";
import ListMovieItems from "./ListMovieItems";

type Props = {
    movieListType : string
};

const MovieListTypePage = (props : Props) => {
    return (
        <>
        <h2>Movies</h2>
        <ListMovieItems movieListType={props.movieListType} />
        </>
    );
};

export default MovieListTypePage;
